MATCH (p:Payer {id: 'd18ef2e6-ef40-324c-be54-34a5ee865625'})-[:HAS_COVERED]->(e:Encounter)
WITH p, e, AVG(e.qols_avg) AS avgQOL
RETURN avgQOL;

MATCH (p:Payer {id: '0133f751-9229-3cfd-815f-b6d4979bdd6a'})-[:HAS_COVERED]->(e:Encounter)
WHERE NOT (e)-[:IS_COVERED_BY]->(:Payer)
RETURN COUNT(DISTINCT e);

MATCH (p:Payer {name: 'Medicare'})-[:HAS_COVERED]->(e:Encounter)
WHERE NOT (e)-[:IS_COVERED_BY]->(p)
RETURN COUNT(DISTINCT e);
